import React from 'react';


// We'll request user data from this API
const loadUsers = () =>
  fetch("https://jsonplaceholder.typicode.com/users")
    .then(res => (res.ok ? res : Promise.reject(res)))
    .then(res => res.json())

// Our component
function Weather() {
  return (

      <div>{console.log(loadUsers)}
    </div>
  );
}

export default Weather;
